// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract PropertyRegistry {
    struct Property {
        uint256 id;
        address owner;
        string propertyAddress;
        string ownerName;
    }

    mapping(uint256 => Property) private properties;
    uint256 private propertyCounter;

    event PropertyRegistered(uint256 id, address owner, string propertyAddress, string ownerName);
    event OwnershipTransferred(uint256 id, address oldOwner, address newOwner, string newOwnerName);

    constructor() {
        propertyCounter = 0;
    }

    function registerProperty(string memory propertyAddress, string memory ownerName) public {
        propertyCounter++;
        properties[propertyCounter] = Property(propertyCounter, msg.sender, propertyAddress, ownerName);
        emit PropertyRegistered(propertyCounter, msg.sender, propertyAddress, ownerName);
    }

    function transferOwnership(uint256 propertyId, address newOwner, string memory newOwnerName) public {
        require(properties[propertyId].owner != address(0), "Property does not exist");
        require(properties[propertyId].owner == msg.sender, "Only the property owner can transfer ownership");
        address oldOwner = properties[propertyId].owner;
        properties[propertyId].owner = newOwner;
        properties[propertyId].ownerName = newOwnerName;
        emit OwnershipTransferred(propertyId, oldOwner, newOwner, newOwnerName);
    }

    function getProperty(uint256 propertyId) public view returns (uint256, address, string memory, string memory) {
        require(properties[propertyId].owner != address(0), "Property does not exist");
        Property memory property = properties[propertyId];
        return (property.id, property.owner, property.propertyAddress, property.ownerName);
    }
}
